<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8">
  <title>Network Map</title>
  <meta name="viewport" content="width=device-width, initial-scale=1">
</head>
  <body>
    
      <!-- diagrams.net (draw.io) network map embed -->
    <div
      class="mxgraph"
      style="width:100%; height:100%; border:0;"
      data-mxgraph='{
        "nav": true,
        "resize": true,
        "dark-mode": "auto",
        "toolbar": "zoom layers lightbox",
        "edit": "_blank",
        "highlight": "#3b82f6",
        "url": "https://drive.google.com/uc?id=1CHvamtBoZzN5Wq8Db9wAsJTlcL_n1njT&export=download"
      }'>
    </div>
    
    <script
      src="https://viewer.diagrams.net/embed2.js"
      referrerpolicy="no-referrer">
    </script>
  
    
  </body>
</html>
